CREATE DATABASE AcademyHomeWork4;
USE AcademyHomeWork4;


CREATE TABLE Curators
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	CurName varchar(100) NOT NULL CHECK (CurName <> N''),
	CurSecondName varchar(100) NOT NULL CHECK (CurSecondName <> N'')
);
SELECT * FROM Curators;


CREATE TABLE Departments
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	Building int NOT NULL CHECK (Building BETWEEN 1 AND 3),
	Financing int NOT NULL CHECK (Financing >= 0) DEFAULT 0,
	DepName varchar(100) NOT NULL UNIQUE CHECK (DepName <> N''),
	FacultyId int NOT NULL
);
SELECT * FROM Departments;


CREATE TABLE Faculties
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	FacName varchar(100) NOT NULL UNIQUE CHECK (FacName <> N'')
);
SELECT * FROM Faculties;


CREATE TABLE StudGroups
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	GroupName varchar(100) NOT NULL UNIQUE CHECK (GroupName <> N''),
	Course int NOT NULL CHECK (Course BETWEEN 1 AND 5),
	DepartmentId int NOT NULL
);
SELECT * FROM StudGroups;


CREATE TABLE GroupsCurators
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	CuratorId int NOT NULL,
	GroupId int NOT NULL
);
SELECT * FROM GroupsCurators;


CREATE TABLE GroupsLectures
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	GroupId int NOT NULL,
	LectureId int NOT NULL
);
SELECT * FROM GroupsLectures;



CREATE TABLE GroupsStudents
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	GroupId int NOT NULL,
	StudentId int NOT NULL
);
Select * From GroupsStudents;


CREATE TABLE Lectures
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	LectDate date NOT NULL /*CHECK (LectDate <= SYSDATE())*/ ,
	SubjectId int NOT NULL,
	TeacherId int NOT NULL
);
SELECT * FROM Lectures;


CREATE TABLE Students
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	StudName varchar(100) NOT NULL CHECK (StudName <> N''),
	Rate int NOT NULL CHECK (Rate BETWEEN 0 AND 5),
	StudSecondName varchar(100) NOT NULL CHECK (StudSecondName <> N'')
);
SELECT * FROM Students;



CREATE TABLE Subjects
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	SubjName varchar(100) NOT NULL UNIQUE CHECK (SubjName <> N'')
);
SELECT * FROM Subjects;



CREATE TABLE Teachers
(
	Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	IsProfessor bit NOT NULL DEFAULT 0,
	TeachName varchar(100) NOT NULL CHECK (TeachName <> N''),
	Salary int NOT NULL CHECK (Salary > 0),
	TeachSecondName varchar(100) NOT NULL CHECK (TeachSecondName <> N'')
);
SELECT * FROM Teachers;



ALTER TABLE Departments
ADD FOREIGN KEY (FacultyId) REFERENCES Faculties(Id);

ALTER TABLE StudGroups
ADD FOREIGN KEY (DepartmentId) REFERENCES Departments(Id);

ALTER TABLE GroupsCurators
ADD FOREIGN KEY (CuratorId) REFERENCES Curators(Id);

ALTER TABLE GroupsCurators
ADD FOREIGN KEY (GroupId) REFERENCES StudGroups(Id);

ALTER TABLE GroupsLectures
ADD FOREIGN KEY (GroupId) REFERENCES StudGroups(Id);

ALTER TABLE GroupsLectures
ADD FOREIGN KEY (LectureId) REFERENCES Lectures(Id);

ALTER TABLE GroupsStudents
ADD FOREIGN KEY (GroupId) REFERENCES StudGroups(Id);

ALTER TABLE GroupsStudents
ADD FOREIGN KEY (StudentId) REFERENCES Students(Id);

ALTER TABLE Lectures
ADD FOREIGN KEY (SubjectId) REFERENCES Subjects(Id);

ALTER TABLE Lectures
ADD FOREIGN KEY (TeacherId) REFERENCES Teachers(Id);

/* 1. Вывести номера корпусов, если суммарный фонд финансирования расположенных в них кафедр превышает 100000.*/
SELECT Building FROM Departments
GROUP BY Departments.Building
HAVING SUM(Departments.Financing) > 20000;

/* 2. Вывести названия групп 5-го курса кафедры “Software Development”, которые имеют более 10 пар в первую неделю.*/
WITH TableFifthCourse AS (
    WITH lectsDateId AS (
        WITH lectsDateId AS (SELECT Id AS LectId, LectDate FROM Lectures)
        SELECT * FROM lectsDateId
        JOIN GroupsLectures ON (GroupsLectures.LectureId = lectsDateId.LectId)
        HAVING LectDate < '2022-09-08'
    )
    SELECT GroupId, Course, COUNT(GroupId) AS LectsAmount FROM StudGroups
    JOIN lectsDateId ON (lectsDateId.GroupId = StudGroups.Id)
    JOIN Departments ON (Departments.Id = StudGroups.DepartmentId)
    GROUP BY GroupId
    HAVING Course = 5 AND LectsAmount > 25
)
SELECT Id, GroupName FROM StudGroups WHERE DepartmentID = (
    SELECT Id FROM Departments WHERE DepName = "Электроника и Автоматика"
    ) AND Course = 5 AND EXISTS(SELECT * FROM TableFifthCourse WHERE GroupId = Id);


WITH Tablexz AS (
    WITH TableTemp AS (SELECT Id AS LectId, LectDate FROM Lectures)
    SELECT * FROM TableTemp, GroupsLectures
    where (GroupsLectures.LectureId = TableTemp.LectId)
    HAVING LectDate < '2022-09-08'
)
SELECT GroupId, COUNT(GroupId) AS LectsAmount FROM TableXZ
GROUP BY GroupId;
/* 3. Вывести названия групп, имеющих рейтинг (средний рейтинг всех студентов группы) больше, чем рейтинг группы “D221”.*/ 

SELECT StudGroups.GroupName AS "Название группы" , AVG(Rate) AS "Средний бал" FROM StudGroups      
JOIN GroupsStudents ON GroupsStudents.GroupId = StudGroups.Id
JOIN Students ON Students.Id = GroupsStudents.StudentId                                    
GROUP BY StudGroups.GroupName
HAVING AVG(Rate) > (SELECT AVG(Rate) FROM StudGroups
JOIN GroupsStudents ON GroupsStudents.GroupId = StudGroups.Id
JOIN Students ON Students.Id = GroupsStudents.StudentId
GROUP BY StudGroups.GroupName
HAVING StudGroups.GroupName = "МикроЭл/1/2");

/* 4. Вывести фамилии и имена преподавателей, ставка которых выше средней ставки профессоров.*/

select TeachName, TeachSecondName from Teachers
where Teachers.salary > (select avg(salary) from Teachers where isProfessor = 1);

/* 5. Вывести названия групп, у которых больше одного куратора.*/

SELECT GroupName FROM StudGroups WHERE EXISTS (
SELECT GroupID FROM GroupsCurators WHERE StudGroups.ID = GroupID
GROUP BY GroupID
HAVING COUNT(CuratorID) > 1
);

/* 6. Вывести названия групп, имеющих рейтинг (средний рейтинг всех студентов группы) меньше,
 чем минимальный рейтинг групп 5-го курса. */
 
 WITH tableTemp AS (SELECT AVG(Rate) AS Rate FROM Students
JOIN GroupsStudents ON (Students.Id = StudentId)
JOIN StudGroups ON (StudGroups.Id = GroupId)
WHERE StudGroups.Course = 5
GROUP BY GroupID)

SELECT StudGroups.GroupName, AVG(Rate) FROM StudGroups
JOIN GroupsStudents ON GroupsStudents.GroupId = StudGroups.Id
JOIN Students ON Students.Id = GroupsStudents.StudentId
GROUP BY StudGroups.GroupName
HAVING AVG(Rate) > ((SELECT MIN(Rate) FROM tableTemp) + 0.0001);

/* 7. Вывести названия факультетов, суммарный фонд финансирования кафедр которых
 больше суммарного фонда финансирования кафедр факультета “Computer Science”. */
 
 SELECT Faculties.FacName FROM Departments
JOIN Faculties ON (Departments.FacultyId = Faculties.Id)
GROUP BY FacultyId
HAVING SUM(Financing) > (SELECT SUM(Financing) FROM Departments WHERE FacultyID =
                        (SELECT Id FROM Faculties WHERE FacName = "Экономики и Менеджмента"));

/* 8 Вывести названия дисциплин и полные имена преподавателей, читающих наибольшее количество лекций по ним. */
WITH maxLessons AS (
    WITH tableTemp AS (
        SELECT COUNT(TeacherId) AS Amount, TeacherId, SubjectId FROM Lectures
        GROUP BY SubjectId, TeacherId)
    SELECT Subjects.Id AS SubjID, SubjName, Amount, TeacherId FROM Subjects
    JOIN tableTemp ON Subjects.Id = tableTemp.SubjectId
    HAVING (tableTemp.Amount = (SELECT MAX(Amount) FROM tableTemp WHERE SubjectId = Subjects.Id))
)
SELECT SubjName AS "Предмет", TeachName AS "Имя", TeachSecondName AS "Фамилия" FROM maxLessons
JOIN Teachers ON (Teachers.Id = maxLessons.TeacherID);

/* 9 Вывести название дисциплины, по которому читается меньше всего лекций. */

SELECT SubjName FROM Subjects WHERE (Id =
    (WITH lectAmount AS (
        SELECT COUNT(SubjectId) AS Amount, SubjectId FROM Lectures
        GROUP BY SubjectId
    )
    SELECT SubjectId FROM lectAmount WHERE (Amount = (SELECT MIN(Amount) FROM lectAmount))
    )
);

/* 10 Вывести количество студентов и читаемых дисциплин на кафедре “Software Development”.*/ 
WITH depIds AS (SELECT Id FROM Departments WHERE DepName = "Микроэлектроника"),
Studs AS (
    SELECT COUNT(StudentId) AS "StudAmount" FROM GroupsStudents WHERE EXISTS (
        SELECT Id FROM StudGroups WHERE DepartmentId = (SELECT Id FROM depIds) AND id = GroupsStudents.GroupId)),     
Subjs AS (
    WITH TableTemp AS (
        WITH depGroups AS (
            SELECT StudGroups.Id AS GrId FROM StudGroups WHERE StudGroups.DepartmentId = (SELECT * FROM depIds))
        SELECT GroupId, LectureId, SubjectId FROM GroupsLectures
    JOIN Lectures ON Lectures.Id = GroupsLectures.LectureId
    HAVING EXISTS (SELECT * FROM depGroups WHERE GrId = GroupId))
SELECT COUNT(DISTINCT SubjectId) AS "SubjAmount" FROM TableTemp)
SELECT StudAmount, SubjAmount FROM Subjs, Studs;


        

